INSERT INTO `posts` (`post_id`, `post_title`, `post_date`, `post_image`, `post_details`, `post_comment_count`, `post_tag`) VALUES
(7, 'How Chaka is simplifying access to global and local stock markets for Nigerians', '2020-05-29', 'Screenshot (1).png', 'While living in the US in his early teens, Tosin Osibodu had an interest in the stock market. As he grew older he observed the evolution that has taken place in the global stock market.\r\n\r\nIn the US, more investors found easy ways to get into the market and buy stocks; the same couldnï¿½t be said for the Nigerian stock market which had popularity among local and global investors.\r\n\r\nAnd unlike in the US that had a large proportion of individual (retail) involvement, most participants in the Nigerian market were large local and foreign financial institutions as well as high net worth individuals (HNIs).\r\n\r\nNot only is retail investment participation for the Nigerian stock abysmal, but opportunities for participating in global stocks also arenï¿½t fully harnessed.																		', 4, 'opportunities for participating in global stocks also arenï¿½t fully harnessed.'),
(8, 'How Chaka is simplifying access to global and local stock markets for Nigerians', '2020-01-29', 'CHAKA-18.jpg', 'While living in the US in his early teens, Tosin Osibodu had an interest in the stock market. As he grew older he observed the evolution that has taken place in the global stock market.\r\n\r\nIn the US, more investors found easy ways to get into the market and buy stocks; the same couldn’t be said for the Nigerian stock market which had popularity among local and global investors.\r\n\r\nAnd unlike in the US that had a large proportion of individual (retail) involvement, most participants in the Nigerian market were large local and foreign financial institutions as well as high net worth individuals (HNIs).\r\n\r\nNot only is retail investment participation for the Nigerian stock abysmal, but opportunities for participating in global stocks also aren’t fully harnessed.', 4, 'opportunities for participating in global stocks also aren’t fully harnessed.');
